class Wallpaper {
	constructor(value) {
		this.id = value.id;
		this.port = value.port;
		this.ip = value.ip;
		this.name = value.name;

		this.initialized = false;
	}

	update() {
		if (!this.initialized) {
			this.initialized = true;

			service.updateController(this);
			service.announceController(this);
		}
	}
}

